import React from "react";
import CardComponent from "./components/CardComponent";
import "./App.css";

function Proyectos() {
  return (
    <>
      <h1>Proyectos</h1>
      <CardComponent
        title="10k Challenge"
        description="Lorena, help a brother out"
        route="#10Challenge"
      />
    </>
  );
}

export default Proyectos;
